double intercepts[15] = {-0.2537574254072705, 0.24472033738319277, -0.954744644427854, 0.4259176571660398, 2.8082927941474565, 1.9624845821145356, -0.19654779626126068, -0.5850002027819673, 1.8829269231385657, -1.9052370373488612, -0.7152707505909575, 1.9471015883481908, 1.40219973338576, 10.514902197283714, 0.901042665380316};
